import HeroComponent from './hero.style'
import Button from '../Button/button.component'

function Hero(){
  return(
    <HeroComponent>
      <h2>Danilo Mello — UI, UX Designer & Developer</h2>
      <h1>Faço sites e aplicativos intuitivos que impulsionam seus negócios.</h1>
      <Button />
    </HeroComponent>
  )
}

export default Hero
